  false,\n\t\"url\": null,\n\t\"notes\": \"Geographic Extent: SANDY_Restoration_DE_MD_QL2
  Area of Interest covers approximately 3.096 square miles. Lot #5 contains the full
  project area Dataset Description: The SANDY_Restoration_DE_MD_QL2 project called
  for the Planning, Acquisition, processing and derivative products of LIDAR data
  to be collected at a nominal pulse spacing (NPS) of 0.7 meter. Project specifications
  are based on the U.S. Geological Survey National Geospatial Program Base LIDAR Specification,
  Version 1. The data was developed based on a horizontal projection/datum of UTM
  Zone 18 North, NAD83, meters and vertical datum of NAVD1988 (GEOID12A), meters.
  LiDAR data was delivered in RAW flight line swath format, processed to create Classified
  LAS 1.2 Files formatted to 3842 individual 1500m x 1500m tiles, and corresponding
  Intensity Images and Bare Earth DEMs tiled to the same 1500m x 1500m schema, and
  Breaklines in ESRI Shapefile format. Ground Conditions: LiDAR was collected in Winter
  2013 / Spring 2014, while no snow was on the ground and rivers were at or below
  normal levels. In order to post process the LiDAR data to meet task order specifications,
  Quantum Spatial established a total of 78 QA control points and 99 Land Cover control
  points that were used to calibrate the LIDAR to known ground locations established
  throughout the SANDY_Restoration_DE_MD_QL2 project area.\",\n\t\"license_title\":
